import React from 'react';


const followedChannels = [
{
    id: 1,
    username: "Martin",
    isOnline: false,
},
{
    id: 2,
    username: "Marta",
    isOnline: true,
},
{
    id: 3,
    username: "Jack",
    isOnline: false,
},
];

export const Sidebar = () => {
    return (
        <div className='sidebar-container'>
            <span className="sidebar-title">For you</span>
            <span className="sidebar-subtitle">FOLLOWED CHANNELS</span>
        </div>
    );
};
